    "title": "Whats Up Buenos Aires Radio Vol. 2- Free Music Festivals!",
    "description": "Vol. II of WUBA RADIO is here and ready to mutiny your airwaves. \n\nThis episode your host Allie Silver (alliesilver.com) will be spotlighting two FREE music series. The first, beginning Thursday April 8th until next Friday (the 15th) is Pequeña Música Nocturna, a series of concerts put on in conjunction with the Buenos Aires International Festival of Independent Cinema. Each night at 10:30 (except Monday) a musician will be putting on a show at the Abasto Shopping, some directly involved in a featured film (like Pommez Internacional, who created an original soundtrack for La Carrera del Animal), or indirectly related (like Miss Bolivia, whose high energy fits well with the reggae documentary Hit Me With Music). \n\nWe sat down with Javi Sisti Rippol, jack of all trades, singer of the La Plata based band 107 Faunos. The band´s first LP “Creo que Te Amo” serves as the soundtrack and inspiration behind a film of the same name by German Gréco, premiering Saturday April 9 at 8pm and followed by a concert. For the complete BAFICI schedule, click here. www.bafici.gob.ar\nAnd for those that feel like a little bit of adventure La Plata is hosting an International Folklore Festival this weekend. Friday, Saturday and Sunday from 3pm until 11, acts from in and out of Argentina, Terraplén, Tremor, Soema Montenegro and Gustavo Santaolalla, will hopefully chase out the weekend rain forecast with some good vibrations. \nFor directions to the festival click here. http://fifba.com/wp/como-llegar/\n\nListen, enjoy, and until next time stay tuned ! \n\nVol. II de WUBA RADIO ya volvió y estamos listos a revolucionar tu radio ! \nEsta semana te queremos contar sobre dos series de música muy copadas, y, espera, son GRATUITAS ! La primera es Pequeña Música Nocturna, que comienza hoy ya hasta el próximo viernes 15 de abril. Los recitales están en conjunto con el BAFICI, festival anual de cine independiente. Todas las noches (salvo el lunes) arrancan un recital en el Abasto Shopping. Algunos están directamente involucrados con una película del festival (como Pommez Internacional, que hizo el soundtrack de La carrera del animal), o indirectamente relacionados (como Miss Bolivia, que lleva la alta energía que se ajusta bien con el documental reggae Hit me with music). \n\nCharlamos un toque con Javi Sisti Rippol, jack of all trades, cantante de la banda Platense 107 Faunos. Su primer LP “Creo que te amo” es la inspiración y soundtrack tras la película del mismo nombre, la opera prima de German Gréco, que se estrena el sábado 9 de Abril a las 20hs. \n\nY para aquellos que buscan un poco de aventura este finde, en La Plata tendrá lugar el Festival Internacional Folklore Buenos Aires. Tres días (viernes a domingo) música folklore desde las 15 al 20 hs, con agrupaciones argentinas como internacionales (Terraplén, Tremor, Montenegro Soema y Gustavo Santaolalla). Esperamos que expulsen a las lluvias previstas de este finde con sus buenas vibraciones. \n\nPara fijarte en como llegar al festival, clickea aquí. http://fifba.com/wp/como-llegar/\nEscuchen, disfruten, y hasta la próxima, stay tuned ! \n\nPLAYLIST\n1. Tabla Rota- Terraplén\n2. Flores del Desierto- Soema Montenegro\n3. Scotty Pippin y Yo - 107 Faunos\n4. El Viento - Malyevados\n5. Noche Spooky Tropical- 107 Faunos\n6. Ante la Ley- Pommez Internacional\n7. Libelula- Tremor\n",
